import {BrowserRouter, Routes, Route, createBrowserRouter, RouterProvider} from "react-router-dom"
import Students from "./comp/student.jsx"
import Navbar from "./comp/navbar.jsx"
import Lecturers from "./comp/lecturer.jsx";
import Departments from "./comp/department.jsx";
import Login from "./pages/login.jsx";
import './App.css';

const router = createBrowserRouter([
  {
    path: "/",
    element:
      <div>
        <Navbar />
      </div>
  },
  {
    path: "/login",
    element:
    <div>
      <Navbar />
      <Login/>
    </div>
  },
  {
    path: "/allstudents",
    element:
    <div>
      <Navbar/>
      <Students/>
    </div>
  }, 
  {
    path: "/alllecturers",
    element:  
    <div>
      <Navbar/>
      <Lecturers/>
    </div>
  },
  {
    path: "/alldepartments",
    element:  
    <div>
      <Navbar/>
      <Departments/>
    </div>  
  },
]);

function App() {
  return (
    <div className="App">

        <RouterProvider router = {router}/>

    </div>
  );
}

export default App;
